import React, { Component } from "react";
import axios from "axios";
import { Navbar, Nav, } from "react-bootstrap";
import "../App.css";

class Fela extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
      stri: 0,
    };
  }

  getData() {
    axios.get("movie.json").then((response) => {
      var a = response.data;
      this.setState({ data: a });
    });
  }
  componentDidMount() {
    this.getData();
  }


  chage = (e) => {
    if(e.target.value == ""){
    return this.state.data.map((el)=> document.getEelementByClassName("background_6").innerHtml)
}else{

    this.setState({
      stri: e.target.value 
    });}
  };

  render() {
    return (
      <div>


         <Navbar className="nava mb-5 " variant="dark">
        <Navbar.Brand href="#home">

          <img src="/imgs/logi.png" className="logi " alt="logi" />
        </Navbar.Brand>
        <input type="text" onChange={this.chage}   className="mx-auto "id="serch" placeholder="Search" />

        <Nav>


          <Nav.Link href="#home" className="text-white mx-2 ">
            Acceuil
          </Nav.Link>
          <Nav.Link href="#features" className="text-white mx-12">
          cat√©gorie
          </Nav.Link>
          <Nav.Link href="#pricing" className="text-white mx-2">
            Contact
          </Nav.Link>
        </Nav>


        <a href="#"  className="mt-2">
        <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" id="heart" fill="currentColor" class="bi bi-suit-heart-fill" viewBox="0 0 16 16">
  <path d="M4 1c2.21 0 4 1.755 4 3.92C8 2.755 9.79 1 12 1s4 1.755 4 3.92c0 3.263-3.234 4.414-7.608 9.608a.513.513 0 0 1-.784 0C3.234 9.334 0 8.183 0 4.92 0 2.755 1.79 1 4 1z"/>
</svg> <span id="sapa">0</span>
         </a>
      </Navbar>


    <div>


        {this.state.data.filter((x) => x.id.includes(this.state.stri)).map((el) => (
              <div className="background_6">
        <div className="imdb_card">
          <div className="movie_poster">
            <img src={el.poster} alt="tv" />
            <div className="movie_label ">
              <h2 className="">{el.title}</h2>
            </div>
          </div>

          <div className="movie_content">
            <div className="mov_specs ">
              <p>8.5 | 1h 57min | Animation, Action, Adventure</p>
            </div>
            <div className="mov_description d-flex justify-content-center  ">
              <span className="fa fa-star checked "></span>
              <span className="fa fa-star checked"></span>
              <span className="fa fa-star checked"></span>
              <span className="fa fa-star checke "></span>
              <span className="fa fa-star checke "></span>
            </div>
            <div className="buy_ticket">
              <a OnClick="">
                <span>WATCH NOW</span>

                <span>
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    className="mt-1"
                    width="25"
                    height="25"
                    fill="currentColor"
                    class="bi bi-heart-fill"
                    viewBox="0 0 16 16"
                  >
                    <path
                      fill-rule="evenodd"
                      d="M8 1.314C12.438-3.248 23.534 4.735 8 15-7.534 4.736 3.562-3.248 8 1.314z"
                    />
                  </svg>
                </span>
              </a>
            </div>
          </div>
        </div>
      </div>

            ))}
      </div></div>
    );
  }
}

export default Fela;
